import React from 'react';
import styled from 'styled-components';
import Navbar from './Navbar';

function AddProduct() {
  return (
    <Container>
    <Logo>
        <img src="logotry1.jpg" alt="" />
    </Logo>
    <FormContainer>
        <h3>Add Product</h3>
        <InputContainer>
        <p>Title</p>
        <input type="text" />
        </InputContainer>
        <InputContainer>
        <p>Image Url</p>
        <input type="text" />
        </InputContainer>
        <InputContainer>
        <p>Price</p>
        <input type="number" />
        </InputContainer>
         <InputContainer>
        <p>Rating</p>
        <input type="number" />
        </InputContainer>

        <Button>
            Add Product
        </Button>
{/* 
        <InfoText>
        We're excited to join you on your
         fashion journey

        </InfoText> */}

    </FormContainer>
    <SignUpButton>
        Create Account in AnnaJones
    </SignUpButton>
    </Container>
  );
}
const Container = styled.div`
    width : 40%;
    min-width:450px;
    height: fit-content;
    padding:15px;
    margin:auto;
    display:flex;
    flex-direction:column;
    align-items:center;
    line-height:1;
  
`;
const Logo = styled.div`
    padding:0;
    width:200px;
    img{
        width:100%;
    }
`;

const FormContainer =styled.form`
    border:1px solid lightgray;
    width:55%;
    height:400px;
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    padding:15px;

    h3{
        font-size:28px;
        font-weight:400;
        line-height:0px;
        align-self:flex-start;
    }

`;
const InputContainer =styled.div`
    width:100%;
    padding:10px;
    p{
        font-size:14px;
        font-weight:600;
    }

    input{
        width:95%;
        height:36px;
        padding-left:5px;
        border-radius:5px;
        border:1px solid lightgray;
        margin-top:5px;

        &:hover{
            border:1px solid black;
        }
    }

`;


const Button =styled.button`
    width:70%;
    height:40px;
    background-color:#f3b414;
    border:none;
    outline:none;
    border-radius:10px;
    margin-top:10px;


`;
const InfoText = styled.p`


`;

const SignUpButton = styled.button`
    width:55%;
    hight:45px;
    font-size:14px;
    margin-top:30px;


    &:hover{
        background-color:#dfdfdf;
        border:1px solid darkgray;
    }
`;

export default AddProduct
